import { Box, Button, Divider, Grid, TextField, Typography } from '@mui/material'
import { useEffect, useState } from 'react';

function App() {

  const [responsive, setResponsive] = useState(window.innerWidth<1024 ? true : false); // Check if the screen is smaller than 1024

  useEffect(() => {

    window.addEventListener('resize',resize);

    return ()=>{
      window.removeEventListener('resize', resize)
    };
  }, []);

  const resize=()=>{
    setResponsive(window.innerWidth < 1024 ? true : false);
  }
  return (
    <div className="App" >
      {responsive && <div>


        </div>}

      {!responsive && 
      <Grid container style={{ height: "100vh", backgroundColor: "#6c42ec" }}>
        <Grid item xs={12} sm={12} md={3} lg={3} style={{ backgroundColor: "#6c42ec" }}>
          <div style={{ color: 'white' }}>
            <h1 style={{ position: "fixed", left: "2%", top: "11%", fontSize: "2.6rem", color: "#dedea0" }}> Stay on top of
            </h1>
            <h1 style={{ position: "fixed", left: "6%", top: "19%", fontSize: "2.6rem", color: "#dedea0" }}>time tracking</h1>

            <img src='../images/register_page_icon.png' style={{ position: "fixed", left: "9%", top: "33%", width: "400px", height: "auto" }} alt='' />

          </div>
        </Grid>
        <Grid item xs={12} sm={12} md={9} lg={9} style={{ backgroundColor: "white", borderRadius: "20px 0px 0px 20px", textAlign: "center", padding: "25px", height: "100vh", width: "100vw" }}>
          <h2 style={{ marginRight: "35%", marginTop: "60px" }}>Create Account</h2>
          <Grid container spacing={1} style={{ textAlign: "center", justifyContent: "center" }}>
            <Grid item xs={12} sm={12} md={3} lg={3}>
              <TextField
                type='text'
                label='first name'
                placeholder='john'
                required
                sx={{
                  width: "100%"
                }}
              />
            </Grid>
            <Grid item xs={12} sm={12} md={3} lg={3} >
              <TextField
                type='text'
                label='last name'
                placeholder='doe'
                required
                sx={{
                  width: "100%"
                }}
              />
            </Grid>
          </Grid>
          <Box>
            <TextField
              type='text'
              label='Email'
              placeholder='johndoe@gmail.com'
              required
              sx={{
                width: '50%',
                marginTop: "12px"
              }}
            />
          </Box>
          <Box>
            <TextField
              type='password'
              label='password'
              placeholder='password...'
              required
              sx={{
                width: '50%',
                marginBottom: "10px",
                marginTop: "10px"
              }}
            />
          </Box>
          <Button variant='contained' style={{ width: "50%", backgroundColor: "black", textAlign: "start" }}>Create Account</Button>
          <p style={{ fontSize: "0.8rem" }}>Already have an account? <span style={{ color: "violet" }}>Login</span></p>


          <Divider component="span" role="presentation" style={{ width: "50%", position: "relative", left: "25%", margin: "40px 0px 40px 0px" }}>
            <Typography >or</Typography>
          </Divider>

          <Box sx={{ display: "flex", gap: "10px", justifyContent: "center", width: "100%", marginTop: "20px" }}>
            <Button variant='outlined'>Sign up with Google</Button>
            <Button variant='outlined'>Sign up with facebook</Button>
          </Box>
        </Grid>
      </Grid>
}

    </div>

  );
}

export default App;
